import React from 'react';
import './index.css';
import Cards from "./components/card";
import Data from "./components/data"
 import Header from "./components/header"




export default function App()  {
        const allData = Data.map(cards => {
                return (< Cards
                          key={cards.id}
                        img={cards.imageUrl}
                        title={cards.title}
                        sd={cards.startDate} 
                        ed={cards.endDate} 

                        />)

        })
return(
        <div>
        < Header />
        {allData}
        </div>

)}
